import { Helmet } from 'react-helmet';
import Samples from '../components/Samples';
import Query from '../components/client/Query';

const Dashboard = (user) => {
  <>
    <Helmet>
      <title> UNO COVID Resources Collection </title>
    </Helmet>
    <Samples />
    <Query />
  </>;
};

export default Dashboard;
